import React, { useState, useEffect } from 'react'
import { Dialog, DialogTitle, IconButton, ListItemIcon, Menu, MenuItem, } from '@mui/material'
import styles from '../styles/CigarCard.module.css'
import inputStyle from '../styles/InputStyles.module.css'
import MoreVertIcon from '@mui/icons-material/MoreVert'
import EditIcon from '@mui/icons-material/Edit'
import DeleteIcon from '@mui/icons-material/Delete'
import axios from 'axios'






const CigarCard = (props) => {

    const { deleteFilter, cigarList } = props
    const [ brand, setBrand ] = useState('')
    const [ name, setName ] = useState('')
    const [ description, setDescription ] = useState('')
    const [ image, setImage ] = useState('')
    const [ rating, setRating ] = useState('')

    const [openDialog, setOpenDialog] = useState(false);
    const [anchorEl, setAnchorEl] = React.useState(null);
    const open = Boolean(anchorEl);


    const handleClickOpen = () => {
    setOpenDialog(true);
    };

    const handleCloseDialog = () => {
    setOpenDialog(false);
    };

    
    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    };
    const handleClose = () => {
        setAnchorEl(null);
    };
    
    useEffect(() => {
        const getCigars = async () => {
            try {
                const res = await axios.get(`http://localhost:8000//api/cigars/${cigarList.id}`)
                console.log(res)
                console.log(res.data)
                setBrand(res.data)
                setName(res.data)
                setDescription(res.data)
                setRating(res.data)
                
            } catch (error) {
                console.log(error)
            }
        }
        getCigars()
    }, [])
    

    const submitHandler = () => {

    }


    return (
        
                <div className={styles.container}>
                    <div className={styles.cardHeader}>
                        <div className={styles.cardHeaderText}>
                            <p>{brand}</p>
                            <p>{name}</p>
                        </div>
                        <div className={styles.cardMenu}>
                            <IconButton
                            aria-label='Options'
                            id='long-button'
                            aria-controls={open ? 'long-menu' : undefined}
                            aria-expanded={open ? 'true' : undefined}
                            aria-haspopup='true'
                            onClick={handleClick}
                            >
                            <MoreVertIcon/>
                            </IconButton>
                            <Menu
                            id='long-menu'
                            MenuListProps={{
                                'aria-labelledby': 'long-button',
                            }}
                            anchorEl={anchorEl}
                            open={open}
                            onClose={handleClose}
                            >
                            <MenuItem onClick={handleClickOpen}>
                                <ListItemIcon>
                                    <EditIcon fontSize='small'/>
                                </ListItemIcon>
                                Edit Cigar
                            </MenuItem>
                            <MenuItem onClick={deleteFilter}>
                                <ListItemIcon >
                                    <DeleteIcon fontSize='small'/>
                                </ListItemIcon>
                                Delete Cigar
                            </MenuItem>
                            </Menu>
                            <Dialog 
                            PaperProps={{
                                style: {
                                    backgroundColor:'var(--bg)',
                                    borderRadius: 'var(--border-radius)'
                                },
                            }}
                            
                            open={openDialog} 
                            onClose={handleCloseDialog} 
                            sx={{}}>
                            <DialogTitle style={{width:'200px', margin:'0 auto', textAlign:'center'}}>Edit Cigar</DialogTitle>
                            <form onSubmit={submitHandler} className={styles.formStyle}>
                                <div className={styles.cigarLabel}>
                                    <div className={styles.inputBox}>
                                        <label>Brand</label>
                                        <input className={inputStyle.input}
                                            onChange={(e) => setBrand(e.target.value)}
                                            value={brand}
                                            name='brand'
                                            type='text'
                                        />
                                    </div>
                                    <div className={styles.inputBox}>
                                        <label>Name</label>
                                        <input className={inputStyle.input}
                                            onChange={(e) => setName(e.target.value)}
                                            value={name}
                                            name='name'
                                            type='text'
                                        />
                                    </div>
                                    
                                </div>
                                <div className={styles.inputBox}>
                                <label>Description</label>
                                <textarea className={inputStyle.textArea}
                                    onChange={(e) => setDescription(e.target.value)}
                                    value={description}
                                    name='description'
                                />
                                </div>
                                
                                <div className={styles.inputBox}>
                                <label>Image</label>
                                <input className={inputStyle.file}
                                    onChange={(e)=>setImage(e.target.files[0])}
                                    name='image'
                                    type='file'
                                />

                                </div>
                                <div className={styles.inputBox}>
                                    <select name="rating" value={rating} onChange={(e) => setRating(e.target.value)} className={inputStyle.rating}>
                                    <option value="none" defaultValue hidden>
                                    Select a Rating
                                    </option>
                                    <option value="0">0</option>
                                    <option value="1">1</option>
                                    <option value="2">2</option>
                                    <option value="3">3</option>
                                    <option value="4">4</option>
                                    <option value="5">5</option>
                                    </select>
                                </div>
                                <input className={styles.inputBox} type='submit' />
                            </form> 

                            </Dialog>
                            

                        </div>
                    </div>
                    
                    <img src={image} alt="cigar" className={styles.cardImg} />
                    <p className={styles.description}>{description}</p>
                    <p className={styles.rating}>Rating: {rating}/5</p>
                    
                </div>
        
    )
}



export default CigarCard
